import numpy as np
import matplotlib.pyplot as plt
from scipy.stats import norm

def plot_gauss(data, dolny_limit=None, gorny_limit=None, tick_frequency=50, x_min=None, x_max=None):
    mean = np.mean(data)
    std_dev = np.std(data)
    
    x = np.linspace(min(data), max(data), 1000)
    
    y = norm.pdf(x, mean, std_dev)
    

    plt.plot(x, y, label=f'Gauss: μ={mean:.2f}, σ={std_dev:.2f}')
    plt.hist(data, bins=50, density=True, alpha=0.6, color='g', label="Histogram")

    if dolny_limit is not None:
        plt.axvline(dolny_limit, color='r', linestyle='--', label=f'Dolny limit: {dolny_limit}')
    if gorny_limit is not None:
        plt.axvline(gorny_limit, color='b', linestyle='--', label=f'Górny limit: {gorny_limit}')
    
    if x_min is not None or x_max is not None:
        plt.xlim(left=x_min, right=x_max)

    min_x, max_x = plt.xlim()
    ticks = np.arange(min_x, max_x, tick_frequency)
    plt.xticks(ticks)

    plt.title('Rozkład normalny (krzywa Gaussa)')
    plt.xlabel('Wartość')
    plt.ylabel('Prawdopodobieństwo')
    plt.legend()
    
    plt.show()


